sys_variable_value.value:
(function execute(inputs, outputs) {

  var aO = [],
      c2lookFor = {
        "Pokemon": -1,
        "Score": -1,
        "Dex": -1
      };

  var csv = new GlideSysAttachment().getContentStream(inputs.attachment);
  var reader = new GlideTextReader(csv);
  var ln = '';

  var headers = [];

  if ((ln = reader.readLine()) != null) {
    headers = ln.split(',')
  }

  if (headers.length)
    for (var c in c2lookFor)
      c2lookFor[c] = headers.indexOf(c);


  while ((ln = reader.readLine()) != null) {
    var row = ln.split(',');
    var item = {};

    for (var col in c2lookFor)
      if (c2lookFor[col]>-1 && row[c2lookFor[col]])
        item[col] = row[c2lookFor[col]]

    if(Object.keys(item).length)
      aO.push(item);
  }

  outputs.array = aO;

})(inputs, outputs);

